import React from 'react';

const NominationItem = ({ nomination, onRemoveNomination }) => {
    return (
        <div>
            <div key={nomination.imdbID}>{nomination.Title}</div>
            <button>Info</button>
            <button onClick={() => onRemoveNomination(nomination)}>Remove</button>
        </div>
    );
};

export default NominationItem;
